import React, { useState } from 'react';
import { bubble as Menu } from 'react-burger-menu';
import './Sidebar.css';
export default props => {
  const [toggle, setToggle] = useState(true);
  return (
    <Menu  isOpen ={toggle}>
      <a className="menu-item" onClick={() => setToggle(!toggle)}href="/">
        Home
      </a>
      <a className="menu-item" onClick={() => setToggle(!toggle)}href="#about">
        about
      </a>
      <a className="menu-item" onClick={() => setToggle(!toggle)}href="#projects">
        Projects
      </a>
      <a className="menu-item" onClick={() => setToggle(!toggle)}href="#contact">
        Contact
      </a>
    </Menu>
  );
};
